import React, { useEffect, useState } from "react";
import { socketService } from "./services/socketService";
import PlayerCounter from "./components/PlayerCounter";
import Grid from "./components/Grid";
import CooldownTimer from "./components/CooldownTimer";
import CharacterModal from "./components/CharacterModal";
import HistorySlider from "./components/HistorySlider";

function App() {
  const [grid, setGrid] = useState<(string | null)[]>(Array(100).fill(null));

  useEffect(() => {
    socketService.connect();
  }, []);

  const handleCellClick = (index: number) => {
    console.log("Clicked cell:", index);
  };

  return (
    <div className="App">
      <h1>Multiplayer Grid App</h1>
      <PlayerCounter count={0} />
      <Grid grid={grid} onCellClick={handleCellClick} />
      <CooldownTimer endTime={Date.now() + 5000} />
      <CharacterModal
        onSubmit={() => {}}
        onClose={() => {}}
        selectedCell={null}
      />
      <HistorySlider history={[]} onTimeChange={() => {}} />
    </div>
  );
}

export default App;
